import {Navbar,Container, NavItem} from 'react-bootstrap';
import { NavLink as Link} from 'react-router-dom';
import './navbar.css';
const navbar = () => {
     const navStyle=({isActive})=>{
        return {
          fontWeight:isActive ? 'bold':'normal',
          // textDecoration:isActive ? 'underline':'none',
          backgroundColor :isActive ?'lavender':'whitesmoke',
          textDecoration:'none',
          
        }
     }
   
  return (
    <div>
      <Navbar expand="md" className='navbars'>

        <div className='container' id='navbar-nav' style={{borderRadius:"10px"}}>
        <Navbar.Collapse id="basic-navbar-nav" className='navList'  >
         <NavItem>
         <Link  style={navStyle} to="/home">Home</Link>
         </NavItem>
         <NavItem>
         <Link to="/about" style={navStyle}>About</Link>
         </NavItem>
        <NavItem>
         <Link to="/contact"  style={navStyle}>Contact</Link>
        </NavItem>
          </Navbar.Collapse>
          <Link to='/signup' className="btn btn-danger" class="me-auto">Signup</Link>
        </div>
      </Navbar>
    </div>
  )
}

export default navbar;
